const Skills = () => {
  return (
    <section style={{ padding: '4rem 2rem', maxWidth: '700px', margin: '0 auto' }}>
      <h2 style={{ fontSize: '2rem', marginBottom: '1rem' }}>Skills</h2>
      <ul style={{ lineHeight: '2' }}>
        <li>React.js, JavaScript, TypeScript, HTML, CSS</li>
        <li>Tailwind, Bootstrap, PHP</li>
        <li>SwiftUI, UIKit, Swift</li>
      </ul>
    </section>
  );
};

export default Skills;
